import React, { useState } from 'react';
import './App.css';
import DevHome from './Components/DevHome';
import Frontpage from './Components/Frontpage';
import SignIn from './Components/SignIn';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import IndividualDescription from './Components/IndividualDescription';
import WriteNewBlog from './Components/WriteNewBlog';


function App() {

    const [detailArray, setDetailArray] = useState()

  let contentWritings = [
    {
        head: "Best Practices from writing a clean code.",
        author: "Simran Ahuja",

    },
    {
        head: "10 Tips for Writing Clean and Efficient Code",
        author: "Virat Kohli",

    },
    {
        head: "Best Practices for Debugging Your Code",
        author: "Michael Jordan",

    },
    {
        head: "The Future of Programming: Trends and Predictions",
        author: "Christine Stewart",

    },
    {
        head: "Mastering Git: A Comprehensive Guide",
        author: "Dean Ambrose",

    },
    {
        head: "A Beginner's Guide to Machine Learning",
        author: "Christine Stewart",

    },
    {
        head: "Creating Responsive Web Designs with CSS Grid",
        author: "Rohan Pandey",

    },
    {
        head: "Exploring the Power of Serverless Architecture",
        author: "David McGregor",

    },
]


  return (
    <BrowserRouter>
    <div className="App">
    <Routes>
      <Route path='/' element={<Frontpage />}/>
      <Route path='/SignIn' element={<SignIn />}/>
      <Route path='/Home' element={<DevHome contentWritings={contentWritings}/>}/>
      <Route path='/Details' element={<IndividualDescription />}/>
      <Route path='/write-new-blog' element={<WriteNewBlog head={contentWritings[0].head}/>} />
    </Routes>
    </div>
    </BrowserRouter>

  );
}

export default App;
